import React, { useState, useEffect } from "react";
import { DataTable } from "primereact/datatable";
import { Column } from "primereact/column";
import { Dropdown } from 'primereact/dropdown';
import { InputText } from 'primereact/inputtext';
// import { MultiSelect } from 'primereact/multiselect';
import { FilterMatchMode } from 'primereact/api';
import axios from "axios";
import data from "./data_table.json"
import "./data_table.css";

const DataTableExample = () => {
  const [posts, setPosts] = useState(data);

  const [filters, setFilters] = useState({
    "IMEI": { value: null, matchMode: FilterMatchMode.START_WITH },
    "CFV": { value: null, matchMode: FilterMatchMode.START_WITH },
    "UFV": { value: null, matchMode: FilterMatchMode.START_WITH },
    'status': { value: null, matchMode: FilterMatchMode.EQUALS },
    "body": { value: null, matchMode: FilterMatchMode.START_WITH },
    'global': { value: null, matchMode: FilterMatchMode.CONTAINS }
  });

  const statuses = [
    'ready', 'unready'
  ];

  const statusBodyTemplate = (rowData) => {
    return <span className={`customer-badge status-${rowData.status}`}>{rowData.status}</span>;
  }

  const statusItemTemplate = (option) => {
    return <span className={`customer-badge status-${option}`}>{option}</span>;
  }

  const statusRowFilterTemplate = (options) => {
    return <Dropdown value={options.value} options={statuses} onChange={(e) => options.filterApplyCallback(e.value)} itemTemplate={statusItemTemplate} placeholder="Select a Status" className="p-column-filter" showClear />;
  }

  // Global Filter
  const [globalFilterValue, setGlobalFilterValue] = useState('');

  const onGlobalFilterChange = (e) => {
    const value = e.target.value;
    let _filters = { ...filters };
    _filters['global'].value = value;

    setFilters(_filters);
    setGlobalFilterValue(value);
  }

  const renderHeader = () => {
    return (
      <div className="flex justify-content-end">
        <span className="p-input-icon-left">
          <i className="pi pi-search" />
          <InputText value={globalFilterValue} onChange={onGlobalFilterChange} placeholder="Keyword Search" />
        </span>
      </div>
    )
  }

  const header = renderHeader();

  // Clear Filter

  const clearFilter = () => {
    initFilters1();
  }

  const initFilters1 = () => {
    setFilters1({
        'global': { value: null, matchMode: FilterMatchMode.CONTAINS },
        'name': { operator: FilterOperator.AND, constraints: [{ value: null, matchMode: FilterMatchMode.STARTS_WITH }] },
        'country.name': { operator: FilterOperator.AND, constraints: [{ value: null, matchMode: FilterMatchMode.STARTS_WITH }] },
        'representative': { value: null, matchMode: FilterMatchMode.IN },
        'date': { operator: FilterOperator.AND, constraints: [{ value: null, matchMode: FilterMatchMode.DATE_IS }] },
        'balance': { operator: FilterOperator.AND, constraints: [{ value: null, matchMode: FilterMatchMode.EQUALS }] },
        'status': { operator: FilterOperator.OR, constraints: [{ value: null, matchMode: FilterMatchMode.EQUALS }] },
        'activity': { value: null, matchMode: FilterMatchMode.BETWEEN },
        'verified': { value: null, matchMode: FilterMatchMode.EQUALS }
    });
    setGlobalFilterValue('');
}


  return (
    <div class="datatable-filter-real">
      <DataTable
        value={posts}
        responsiveLayout="scroll"
        paginatorTemplate="FirstPageLink PrevPageLink PageLinks NextPageLink LastPageLink CurrentPageReport RowsPerPageDropdown"
        dataKey="id"
        paginator
        emptyMessage="No data found."
        className="datatable-responsive"
        currentPageReportTemplate="Showing {first} to {last} of {totalRecords} posts"
        rows={5}
        showGridlines
        filters={filters}
        filterDisplay="row"
        header={header}
      // globalFilterFields={['IMEI', 'CFV.IMEI', 'UFV.IMEI','status']}
      // loading={}
      // globalFilterFields={}
      // header={}
      >
        <Column field="IMEI" filter filterPlaceholder="Search by IMEI" sortable header="IMEI"></Column>
        <Column field="CFV" filter filterPlaceholder="Search by Current Firmware Version" sortable header="Current Firmware Version"></Column>
        <Column field="UFV" filter filterPlaceholder="Search by Update Firmware Version" sortable header="Update Firmware Version"></Column>
        <Column field="status" header="Status Check" showFilterMenu={false} filterMenuStyle={{ width: '14rem' }} style={{ minWidth: '12rem' }} body={statusBodyTemplate} filter filterElement={statusRowFilterTemplate} />
        <Column field="body" filter sortable header="body"></Column>
      </DataTable>
    </div>
  );
};

export default DataTableExample;
